I read through the original report. That looks very unfortunate. It is possible something got corrupted in the project and the fastest way to fix it *might* be to create a new project and copy all the content from the old project to the new project.

Before doing that there are some things to try. First, have you done `pub get` recently? How about `pub upgrade`? If that doesn't help, can you make a copy of your old project to experiment with? I'd like to know what happens if you delete the `.idea` directory, then launch the IDE. Also, try deleting the `build` directory then running your app. Another one to try is `.dart_tool` but if you delete it be sure to do `pub get` again. Let us know.

@helin24 do you have any other suggestions?

@helin24 No, it's mobile. I upgraded  the `gradle`, I think that's why I cannot debug. 

